export default props => {

    function mostrar() {
        console.log(props.numeros)
        for(let i = 0; i < props.numeros.length; i++) {
            return (<div>{props.numeros[i]}</div>)
        }
    }

    return (
        <div>
            <h4 onMouseDown={mostrar}>Os números gerados são: </h4>
        </div>
    )
}

